        <Image src="flower1222.png" width={400} height={200}></Image>
      </div>
      <style jsx>{`
        .imagecontainer {
          max-width: 100%;
        }

        .image {
          width: 100%;
        }
      `}</style>
    </>
  );
};

export default Footer;
